import styles from './Header.module.css'
import {Link} from "react-router-dom";


function Header() {
    return (
        <div className={styles.header_body}>
           <Link to="/"  className={styles.header_logo}>
               Vocabulary
           </Link>
        </div>
    )
}

export default Header;
